import React from 'react';
import '../styles/textarea.css';

const e = React.createElement;

class Console extends React.Component{

    constructor(props){
        super(props)
        console.log(props);
    }

    renderLines(){
         this.props.console.map(line=>{
             console.log(line);
            return line + "\n";
        });
    }

    render(){
        return e(
            'textarea',
            {
                className:'console',
            },
            this.renderLines()
        )
    }


}

export default Console;
